import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import Form from './Form';

function Income() {
    const history = useNavigate();
    useEffect(() => {
        if (localStorage.getItem('token')) {
            history("/income");
        }
        else {
            history("/");
        }
    }, [])
    return (
        <div>
            <Form />
        </div>
    )
}

export default Income
